<span class="line"><span style="color:#A6ACCD;">    echo </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">   git clone git://codeaurora.org/quic/la/platform/vendor/qcom-opensource/tools</span><span style="color:#89DDFF;">&quot;</span></span>
